import React from "react"
import Thumbnail from './Thumbnail.js'; // Import the Thumbnail component
import './App.css';
import snakeThumbnail from './images/snakeProject.png';
import d3PlotThumbnail from './images/GradientOnePlot.png';

import planitThumbnail from './images/travel-plan.jpg';

import Background from './images/half-moon.jpg';

let backgroundStyle = {
	//backgroundImage: `linear-gradient(to bottom right, red, yellow)`,
  // backgroundImage: `url(${Background})`,
  //backgroundAttachment: 'fixed',
  //backgroundSize: `50%`
};
let moonStyle = {

}

function Projects(props) {
  return (
    <div className="container-fluid project-container" style={ backgroundStyle }>
    	<div style={{ margin: `20px` }}>
    		<h1>Projects</h1>
    	</div>
    	<div className="row">
		    <div className="col-sm">
		      <Thumbnail
			  		link="https://examples.gradientone.com/results/R4573773855883741"
			  		image={d3PlotThumbnail}
			  		title="Interactive D3 Plot"
			  		category="Data Visualization"
			  		externalLink = "true"
					/>
		    </div>
		    <div className="col-sm">
		      <Thumbnail
			  		link="/snake"
			  		image={snakeThumbnail}
			  		title="Play Snake"
			  		category="Mini Game using D3"
			  		externalLink = "false"
					/>
		    </div>

		  </div>
		  <div className="row">
		  	<div className="col-sm">
		      <Thumbnail
			  		link="/planit"
			  		image={planitThumbnail}
			  		title="Map Project"
			  		category="Travel app using Google API"
			  		externalLink = "false"
					/>
		    </div>
		    <div className="col-sm">
		    </div>
		  </div>
    </div>
  )
}

export default Projects;
